import React from 'react';
import 'antd/dist/antd.css';
import './index.css';
import { Layout, Menu, Breadcrumb } from 'antd';

const { Header, Content, Footer } = Layout;


const App = () => {
    return (
        <Layout className="layout">
            <Header>
                <div className="logo" />
                <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
                    <Menu.Item key="1" icon={<LineOutlined />}>
                        <NavLink  to="/main">Главная</NavLink>
                    </Menu.Item>
                    <Menu.Item key="2" icon={<LineOutlined />}>
                        <NavLink  to="/tomorrow">Сотрудники</NavLink>
                    </Menu.Item>

                </Menu>
            </Header>
            <Content style={{ padding: '0 50px', minHeight: '100vh', margin: '50px'}}>

                <div className="site-layout-content">Content</div>
            </Content>
            <Footer style={{ textAlign: 'center' }}>©2020 Created by Ivan Sidarau</Footer>
        </Layout>
        )

}

export default App;
